import React, { Component } from "react";
import { Card, Image } from "semantic-ui-react";

class ProjectCard extends Component
{
    render()
    {
        const { image, title } = this.props.project;

        return (
            <Card link>
                <Image src={image} />
                <Card.Content>
                    <Card.Header>{title}</Card.Header>
                </Card.Content>
            </Card>
        );
    }
}

export default ProjectCard;
